    checkSubNouns(actualValues) {
        actualValues.forEach((text) => {
            cy.get('td.multiLayoutButtonNoLeftBorderTextSelected[align="center"],td.multiLayoutButtonText[align="center"]').contains(text).should('be.visible').click()

            cy.wait(3000)
            cy.get('body', { withinSubject: null }).then((body) => {
                if (body.find('div:visible').filter((_, el) =>
                    el.innerText.trim().toLowerCase() === 'No items to show'
                ).length > 0) {
                    throw new Error('Failing Test Case because of No Data');
                }
            });
        });

    }
